import React, { useState } from 'react';
import { Route, Link, json, Switch, useNavigate  } from 'react-router-dom';
import Info from './frontend/information/Information';
import Data from './frontend/data/Data';
import Preview from './frontend/preview/Preview';
import { multiStepContext } from './frontend/stepcontext/StepContext';
import './App.css';


export default function App() {
  const {finalData} = useContext(multiStepContext);
return (

      <>
      <Switch>
      <Route   exact path="/" component= {Info}/>
      <Route  path = "/data" component={Data}/>
      <Route  path = "/preview" component={Preview}/>


      </Switch>
      {/* <Data />
      <Info /> */}
      <div className ='App'>
          {finalData.length > 0 ? <Data />: ''}

      </div>


      </>


  );
}
